import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '150px',
        width: '150px',
        backgroundColor: 'black',
        display: 'flex',
        alignItems: 'center',
        paddingTop: '20px',
    },
    menuIcon: {
        width: '100px',
        height: '100px'
    }
});
